import AddUser from './components/Users/AddUser';
import UserList from './components/Users/UserList';

function App() {
  const [userList , setUserList]=useState([]);
  return (
    <div>
      <AddUser onAddUser={setUserList}/>
      <UserList users={userList}/>
    </div>
  );
}

export default App;
